El @parlament amb més diputades de la història tendrà na 
@LauraBorras de presidenta, dues vicepresidentes i quatre secretaris. <U+0001F44F> 
Enhorabona!

@KRLS @LauraBorras @parlamentcat @JuntsXCat Et veia en tasques executives, però també reeixiràs com a Presidenta del Parlament. 

És un càrrec d’honor i d’evident perillositat judicial, que t’obligarà a adquirir expertesa tècnica per moderar situacions tenses i t’exigirà molta fermesa en el compromís.

Força, @LauraBorras!

Moltes felicitats,
Molt Honorable Presidenta del Parlament de Catalunya
